import React, { useEffect, useRef, useState } from 'react';
import styled from 'styled-components';
import { Property } from '../types';

const MapContainer = styled.div`
  width: 100%;
  height: 100%;
  min-height: 400px;
  background: #f0f0f0;
  display: flex;
  align-items: center;
  justify-content: center;
  color: #666;
  font-size: 1rem;
  position: relative;

  /* 마름모형 기호 완전 제거 */
  .gmnoprint {
    display: none !important;
  }
  
  /* 지도 타입 컨트롤 완전 제거 */
  .gm-style-mtc {
    display: none !important;
  }
  
  /* 모든 불필요한 컨트롤 제거 */
  .gm-style button[title*="Map"] {
    display: none !important;
  }
`;

const SatelliteButton = styled.button`
  position: absolute;
  top: 10px;
  left: 10px;
  z-index: 1000;
  background: white;
  border: 2px solid #2563eb;
  border-radius: 6px;
  padding: 10px 16px;
  font-size: 14px;
  font-weight: 600;
  color: #2563eb;
  cursor: pointer;
  box-shadow: 0 4px 8px rgba(0, 0, 0, 0.2);
  transition: all 0.2s;
  min-width: 80px;
  text-align: center;

  &:hover {
    background: #2563eb;
    color: white;
    transform: translateY(-1px);
    box-shadow: 0 6px 12px rgba(0, 0, 0, 0.3);
  }

  &.active {
    background: #2563eb;
    color: white;
    border-color: #1d4ed8;
  }
`;

interface GoogleMapProps {
  properties: Property[];
  onMarkerClick?: (property: Property) => void;
  center?: { lat: number; lng: number };
  zoom?: number;
}

declare global {
  interface Window {
    google: any;
  }
}

const GoogleMap: React.FC<GoogleMapProps> = ({
  properties,
  onMarkerClick,
  center = { lat: 37.5665, lng: 126.9780 }, // 서울 중심
  zoom = 10 // 서울 중심에 맞는 줌 레벨
}) => {
  const mapRef = useRef<HTMLDivElement>(null);
  const mapInstance = useRef<any>(null);
  const markersRef = useRef<any[]>([]);
  const [isSatellite, setIsSatellite] = useState(false);

  // 위성지도 토글 함수
  const toggleSatellite = () => {
    if (mapInstance.current) {
      const newMapType = isSatellite 
        ? window.google.maps.MapTypeId.ROADMAP 
        : window.google.maps.MapTypeId.SATELLITE;
      
      mapInstance.current.setMapTypeId(newMapType);
      setIsSatellite(!isSatellite);
    }
  };

  // 지도 초기화
  useEffect(() => {
    const initMap = () => {
      if (!mapRef.current || !window.google || !window.google.maps) {
        return false;
      }

      try {
        // 기존 마커들 제거
        markersRef.current.forEach(marker => {
          if (marker && marker.setMap) {
            marker.setMap(null);
          }
        });
        markersRef.current = [];

        // 지도 생성
        const map = new window.google.maps.Map(mapRef.current, {
          center,
          zoom,
          mapTypeId: window.google.maps.MapTypeId.ROADMAP,
          zoomControl: true,
          mapTypeControl: false,
          scaleControl: false,
          streetViewControl: false,
          rotateControl: false,
          fullscreenControl: false,
          gestureHandling: 'greedy',
          // 대한민국 본토만 표시 (주변국 최소화)
          restriction: {
            latLngBounds: {
              north: 38.0, // 최북단 (강원도)
              south: 34.5, // 최남단 (경남)
              east: 131.0, // 최동단 (울릉도)
              west: 125.0  // 최서단 (서해안)
            },
            strictBounds: false // 경계를 넘어서도 줌 가능하도록
          },
          // 최소 줌 레벨 설정 (본토 중심)
          minZoom: 8,
          // 최대 줌 레벨 설정
          maxZoom: 18
        });

        mapInstance.current = map;

        // 마커 생성
        properties.forEach(property => {
          const marker = new window.google.maps.Marker({
            position: property.location,
            map,
            title: property.title,
            icon: {
              url: 'data:image/svg+xml;charset=UTF-8,' + encodeURIComponent(`
                <svg width="24" height="24" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
                  <path d="M12 2C8.13 2 5 5.13 5 9c0 5.25 7 13 7 13s7-7.75 7-13c0-3.87-3.13-7-7-7zm0 9.5c-1.38 0-2.5-1.12-2.5-2.5s1.12-2.5 2.5-2.5 2.5 1.12 2.5 2.5-1.12 2.5-2.5 2.5z" fill="#2563eb"/>
                </svg>
              `),
              scaledSize: new window.google.maps.Size(24, 24),
              anchor: new window.google.maps.Point(12, 12)
            }
          });

          if (onMarkerClick) {
            marker.addListener('click', () => {
              onMarkerClick(property);
            });
          }

          markersRef.current.push(marker);
        });

        return true;
      } catch (error) {
        console.error('지도 초기화 오류:', error);
        return false;
      }
    };

    // Google Maps API 로딩 확인 및 지도 초기화
    const checkAndInit = () => {
      if (window.google && window.google.maps) {
        if (initMap()) {
          return;
        }
      }
      
      // API가 로드되지 않았으면 100ms 후 다시 시도
      setTimeout(checkAndInit, 100);
    };

    checkAndInit();

    // 컴포넌트 언마운트 시 정리
    return () => {
      markersRef.current.forEach(marker => {
        if (marker && marker.setMap) {
          marker.setMap(null);
        }
      });
      markersRef.current = [];
    };
  }, [properties, onMarkerClick, center, zoom]);

  return (
    <MapContainer ref={mapRef}>
      <SatelliteButton 
        onClick={toggleSatellite}
        className={isSatellite ? 'active' : ''}
      >
        {isSatellite ? '일반지도' : '위성지도'}
      </SatelliteButton>
    </MapContainer>
  );
};

export default GoogleMap;
